import React from "react";
import "./sidebar.css";
import MenuIcon from "@mui/icons-material/Menu";

const Toolbar = () => {
  return (
    <div className="tool-bar">
      <div className="menu">
        <MenuIcon />
      </div>
      <div className="title"> Doctor Dashboard</div>
    </div>
  );
};

export default Toolbar;
